            <div className='keyboard'>
                <div className='row1'>
                    <Key letter="Q"/>
                    <Key letter="W"/>
                    <Key letter="E"/>
                    <Key letter="R"/>
                    <Key letter="T"/>
                    <Key letter="Y"/>
                    <Key letter="U"/>
                    <Key letter="I"/>
                    <Key letter="O"/>
                    <Key letter="P"/>
                </div>

            </div>

        )
    }
}

export default KeyBoard;
